import React from 'react';
import { Container } from 'react-bootstrap';

const AllPets = () => {
    const location = useLocation()
    const isLogin = location.pathname === LOGIN_ROUTE
    return (
        isLogin ? <LoginForm /> : <RegistrationForm />
    );
};

export default AllPets;
